const saveGenre = books => {
  console.log(books);
  return books.filter(book => {
    if (book.volumeInfo && book.volumeInfo.categories) {
      return book.volumeInfo.categories.includes("Biography & Autobiography");
    }
  });
};
export default saveGenre;
